import TableContainer from "@mui/material/TableContainer";
import React, { useContext, useState, useEffect } from "react";
import { styled, createTheme, ThemeProvider } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Container from "@mui/material/Container";
import Paper from "@mui/material/Paper";
import Navbar from "../../components/Navbar";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import Copyright from "../../components/Copyright";
import { useNavigate } from "react-router-dom";
import Count from "../../context/Count";
import { FormControl, InputLabel, MenuItem, Select } from '@mui/material';

const defaultTheme = createTheme();

function CreateUsers() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("");
  const navigate = useNavigate();
  const [title, setTitle] = useContext(Count);
  const [selectedValue, setSelectedValue] = useState('');

  async function handlesubmit(e) {
    e.preventDefault();
    const user = {
      name,
      email,
      password,
      role_id: role,
    };

    try {
      const response = await fetch("http://localhost:7000/users", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(user),
      });
      if (response.ok) {
        const data = await response.json();
        console.log("User created:", data);
        navigate("/users"); // Redirect to the desired path
      } else {
        console.error("Failed to create user:", await response.text());
      }

      console.log("User created:", response);
      // Handle success, e.g., reset form or show a success message
    } catch (error) {
      console.error("Error creating user:", error);
      // Handle error, e.g., show an error message
    }
  }

  const CustomBox = styled(Box)({
    padding: 10,
  });
  const CustomBox_For_Form = styled(Box)({
    paddingTop: 50,
    paddingBottom: 50,
    paddingLeft: 100,
    paddingRight: 100,
  });
  useEffect(() => {
    setTitle("Create User");
  }, []);

  return (
    <div>
      <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
        <CustomBox>
          <TableContainer component={Paper}>
            <div>
              <CustomBox_For_Form>
                <form onSubmit={handlesubmit}>
                  <TextField
                    label="Name"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                  />

                  <TextField
                    label="Email"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                  />
                  <TextField
                    label="Password"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                  />
                  <TextField
                    label="Role_id"
                    variant="outlined"
                    fullWidth
                    margin="normal"
                    value={role}
                    onChange={(e) => setRole(e.target.value)}
                  />
                  <InputLabel id="dropdown-label">Select Role</InputLabel>
                  <Select
                    labelId="dropdown-label"
                    id="dropdown"
                    value={selectedValue}
                    label="Select an option"
                    variant="outlined"
                    FullWidth
                    margin="normal"
                    
                  >
                    <MenuItem value={"66ab2dbbe525f1294827dbcc"}>Admin</MenuItem>
                    <MenuItem value={"66ab2e0be525f1294827dbcd"}>Landlord</MenuItem>
                    <MenuItem value={"66ab2e2ee525f1294827dbce"}>Tenants</MenuItem>
                    
                  </Select>

                  <Button variant="contained" color="primary" type="submit">
                    Create User
                  </Button>
                </form>
              </CustomBox_For_Form>
            </div>
          </TableContainer>
        </CustomBox>

        <Copyright />
      </Container>
    </div>
  );
}

export default CreateUsers;
